import { makeStyles } from '@material-ui/core/styles';
import { deepPurple, grey } from '@material-ui/core/colors';

export default makeStyles((theme) => ({
//   appBar: {
//     // borderRadius: 15,
//     // margin: '30px 0',
//     // display: 'flex',
//     // flexDirection: 'row',
//     // justifyContent: 'space-between',
//     // alignItems: 'center',
//     // padding: '10px 50px',
//     position : "static",
//     color : "inherit"
//   },

  appBar: {
    borderRadius: 5,
    margin: '0px',
    display: 'flex',
    flexDirection: 'row',
    justifyContent: 'left',
    alignItems: 'center',
    position : 'absolute',
    left:0,
    top:0
  },
  heading: {
    color : grey,
  },
  image: {
    marginLeft: '15px',
  },
  toolbar: {
    display: 'flex',
    justifyContent: 'flex-end',
    width: '1000px',
  },
  profile: {
    display: 'flex',
    justifyContent: 'space-between',
    width: '400px',
  },
  userName: {
    display: 'flex',
    alignItems: 'center',
  },
  brandContainer: {
    display: 'flex',
    alignItems: 'center',
  },
  purple: {
    color: theme.palette.getContrastText(deepPurple[500]),
    backgroundColor: deepPurple[500],
  },
}));
